const Hammer = require('')
(
  function($) {

    init()

    console.log("Scripts OK!");
  }()
)

function init() {

  let logo = document.querySelector(".App-logo")
  let hammer = new Hammer(logo)

  hammer.on('press', (e) => {
    e.target.classList.toggle('expand')
    console.log("You are pressing Logo");
    console.log(e);
  })

}
